<div style="margin: 0in 0in 0pt"><strong><font face="Calibri">Mainframe programmer, 3 month<span style="color: #1f497d">s +/Boston, MA</span></font></strong></div>
<div style="margin: 0in 0in 0pt"><strong><font face="Calibri">*must interview in person</font></strong></div>
<div style="margin: 0in 0in 0pt"><strong>&nbsp;</strong></div>
<div style="margin: 0in 0in 0pt"><strong><u><font face="Calibri">Scope of Services</font></u></strong></div>
<div style="margin: 0in 0in 0pt">&nbsp;</div>
<div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">The Mainframe Systems Programmer will assist with the following:</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">FICON/ESCON director removal</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">zOS 1.11 upgrade</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">Knowledge transfer to the team</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">Evaluate Mainframe for best practices/health check</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">Daily support tasks</span></div>
<div style="margin: 0in 0in 0pt">&nbsp;</div>
<div style="margin: 0in 0in 0pt"><strong><font face="Calibri">Other Duties:</font></strong></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><font face="Calibri">Report to the Director of Hosting Services</font></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Provide support for the <strong>zOS</strong> operating systems</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><font face="Calibri"><span style="color: black">Install and maintain zOS operating system and associated components, such as <strong>JES2, ISPF, SDSF, VTAM, etc.</strong></span></font></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Install and maintain ISV system products as required on the ZOS mainframes</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Implement projects to customize operating system software to support the customer environment.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Provide programming support for the customer MVS exits and in-house written system programs.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Provide technical support to the customer Application Development organization.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Provide technical support to Data Center Operations</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Coordinate hardware and software installations in the customer Data Centers.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Provide technical justifications for hardware and software upgrades</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Work closely with hardware and software vendors regarding problem resolution and regarding new products and services.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Provide management reports regarding the MVS systems as necessary.</font></span></div>
<div style="margin: 0in 0in 0pt">&nbsp;</div>
<div style="margin: 0in 0in 0pt"><strong><font face="Calibri">Deliverables</font></strong></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">FICON/ESCON director removal detailed plan</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">zOS 1.11 upgrade plan</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">Knowledge transfer to the team</span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol; color: black; font-size: 11pt">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: 'Calibri','sans-serif'; color: black; font-size: 11pt">Evaluate Mainframe for best practices/health check and document deficiency&rsquo;s and remediation plan</span></div>
<div style="margin: 0in 0in 0pt">&nbsp;</div>
<div style="margin: 0in 0in 0pt"><strong><font face="Calibri">Qualifications: </font></strong></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Specific knowledge of MVS internals.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Specific knowledge of MVS-related products such as JES2, ACF2, VTAM, SYNCSORT, TSO, etc.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">General knowledge of all software/hardware components of the customer zOS systems.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Minimum fifteen years&rsquo; experience in MVS systems programming.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Bachelor&rsquo;s degree with significant coursework in Computer Science or the equivalent in experience.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Demonstrate expertise in written and oral communication skills.</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Ability to understand technical direction</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in"><span style="font-family: Symbol">&middot;<span style="font: 7pt 'Times New Roman'">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="color: black"><font face="Calibri">Ability to adapt to rapidly changing situations</font></span></div>
<div style="text-indent: -0.25in; margin: 0in 0in 0pt 0.75in">&nbsp;</div>
<span style="color: black">
<div style="margin: 0in 0in 0pt"><em><span style="font-family: 'Arial','sans-serif'; color: #5f497a">Thanks &amp; Regards:</span></em></div>
<div style="margin: 0in 0in 0pt">&nbsp;</div>
